import React, {Component, Fragment} from 'react';

class ChannelsComponent extends Component {

    constructor(props) {
        super(props);
    }

    render() {

        return (
            <Fragment>
                {this.props.name}
            </Fragment>
        )
    }
}

export default ChannelsComponent;
